            "Toàn bộ số tiền quyên góp sẽ được sử dụng để trao học bổng cho 15 học sinh có hoàn cảnh khó khăn và tổ chức truyền thông phòng chống xâm hại, bạo lực trẻ em cho học sinh có hoàn cảnh khó khăn tại trường THCS Bình Thắng, Bình Đại, Bến Tre.",
          Content:
            '<p>\n\tBình Thắng là một trong 3 xã ven biển của huyện Bình Đại, tỉnh Bến Tre, có diện tích tự nhiên hơn 1.414 ha, có 3.007 hộ dân với 10.780 nhân khẩu. Đời sống kinh tế của người dân còn gặp nhiều khó khăn, kinh tế gia đình dựa vào lao động tự do khai thác từ thiên nhiên là chính. Nơi đây có nghề đánh bắt hải sản từ lâu đời và được xem là nghề truyền thống của địa phương. Thế nhưng nghề đánh bắt hải sản từ nguồn tự nhiên nên thu nhập bấp bênh, phụ thuộc nhiều vào tình hình thời tiết và nguồn hải sản. Tình trạng giao thông nông thôn trên địa bàn xã gặp rất nhiều khó khăn, các con đường liên xóm - ấp đầy sình lầy, lồi lõm, gây nguy hiểm cho người dân khi vận chuyển hàng hóa và đi lại. \n</p>\n\n<p>\n\tTrường THCS Bình Thắng nằm ở xã biên giới vùng biển Bình Thắng thuộc huyện Bình Đại, tỉnh Bến Tre. Trong năm học 2022 - 2023, số lượng học sinh có hoàn cảnh khó khăn, hộ nghèo, cận nghèo đang theo học tại trường THCS Bình Thắng vẫn còn nhiều. Trường có tổng 320 em học sinh; trong đó có 50 em học sinh có hoàn cảnh khó khăn về kinh tế, phương diện học tập và phương tiện di chuyển; và 20 em thuộc diện gia đình nghèo, cận nghèo. \n</p>\n\n<p>\n\t<strong>Vùng biên giới ven biển còn nhiều em học sinh nghèo khó khăn</strong>\n</p>\n\n<p>\n\tEm Trần Thanh Thuy hiện đang theo học lớp 6/2, là con trai út của anh Trần Thanh Tùng và chị Ngô Thị Thúy. Gia đình em có hoàn cảnh vô cùng khó khăn, nhà không có đất đai canh tác, thu nhập bấp bênh, anh đi làm biển công việc không ổn định, chị làm nội trợ. Thu nhập chính là nguồn thu từ công việc của anh Trần Thanh Tùng. Trong năm học 2022 - 2023, em Thuy luôn cố gắng, phấn đấu trong học tập, không phụ lòng cha mẹ, em đã đạt danh hiệu học sinh Khá.\n</p>\n\n<p>\n\t<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230306133725-638137066458200656.jpg" style="width: 100%;"/>\n</p>\n\n<p style="text-align: center;">\n\t<em>Em Trần Thanh Tuy luôn cố gắng phấn đấu trong học tập để không phụ lòng cha mẹ</em>\n</p>\n\n<p>\n\tEm Lê Thị Yến Nhi là học sinh tớp lớp 8/2, em là con gái lớn trong nhà có 2 chị em gái. Em gái đang theo học lớp 6 cùng trường. Cha mẹ em đã ly hôn từ lâu, vì thế hai chị em sống chung với ông bà ngoại. Cả gia đình sống ở ngoài chòi canh tôm cho chủ cho nên điều kiện sinh sống rất thiếu thốn và bất tiện. Tuy hoàn cảnh gia đình khó khăn là vậy nhưng em Yến Nhi luôn cố gắng phấn đấu trong học tập tốt và đã đạt danh hiệu học sinh Khá trong năm học 2022 - 2023.\n</p>\n\n<p>\n\t<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230306133749-638137066697787622.jpg" style="width: 100%;"/>\n</p>\n\n<p style="text-align: center;">\n\t<em>Cha mẹ ly hôn từ sớm, em Yến Nhi đang sống cùng ông bà ngoại trong căn chòi tạm bợ</em>\n</p>\n\n<p>\n\t<strong>Gây quỹ trao tặng học bổng cho 15 em học sinh có hoàn cảnh khó khăn</strong>\n</p>\n\n<p>\n\tVới tinh thần lá lành đùm lá rách, tương thân tương ái của người Việt Nam, Trung tâm Giáo dục Sức khỏe và Phát triển Cộng đồng Tương Lai – TP.HCM phối hợp cùng Ví MoMo gây quỹ và kêu gọi ủng hộ 30.000.000 đồng cho chương trình trao học bổng và tổ chức truyền thông phòng chống xâm hại, bạo lực trẻ em cho học sinh có hoàn cảnh khó khăn. \n</p>\n\n<p>\n\t<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230306133808-638137066883291217.jpg" style="width: 100%;"/>\n</p>\n\n<p style="text-align: center;">\n\t<em>Chung tay quyên góp trao học bổng dành tặng 15 em học sinh nghèo khó khăn</em>\n</p>\n\n<p>\n\tVới truyền thống và tình cảm yêu thương trẻ em hãy tích cực tham gia ủng hộ thông qua Ví MoMo bạn nhé. Toàn bộ số tiền quyên góp sẽ được sử dụng để trao học bổng cho 15 học sinh có hoàn cảnh khó khăn và tổ chức truyền thông phòng chống xâm hại, bạo lực trẻ em cho học sinh có hoàn cảnh khó khăn tại trường THCS Bình Thắng, Bình Đại, Bến Tre. \n</p>\n\n<p>\n\t<em>* Ngay sau khi chiến dịch được hoàn thành, Ví MoMo cùng Trung tâm Tương Lai sẽ tiến hành trao học bổng và truyền thông ngay cho các em tại địa phương. Mọi thông tin về chương trình sẽ được chúng tôi cập nhật tới độc giả trong các bài viết tiếp theo.</em>\n</p>\n\n<p>\n\t<u><strong>Về Trung tâm Tương Lai:</strong></u><br/>\n\tTrung tâm Giáo dục Sức khỏe và Phát triển Cộng đồng Tương Lai (Trung tâm Tương Lai) thành lập năm 2011 là tổ chức xã hội với sứ mệnh hoạt động vì trẻ em và thanh thiếu niên có hoàn cảnh đặc biệt. Đến thời điểm hiện tại, đã có hơn 30.000 trẻ em và thanh thiếu niên có hoàn cảnh đặc trên khắp 20 tỉnh thành cả nước được hưởng lợi. Trung tâm Tương lai không chỉ giúp đỡ về mặt tài chính mà còn quan tâm giúp đỡ trẻ em và thanh thiếu niên về hướng nghiệp, kỹ năng sống và vui chơi giải trí lành mạnh.\n</p>\n',
