          Content:
            '<p>\n\t<strong>Để trẻ em nghèo được khám sàng lọc tim bẩm sinh ít nhất một lần trong đời</strong>\n</p>\n\n<p>\n\tDị tật tim bẩm sinh là những dị tật của cơ tim, van tim và buồng tim xảy ra ngay từ lúc trẻ còn trong bụng mẹ và tồn tại sau khi trẻ được sinh ra đời, làm ảnh hưởng đến hoạt động và chức năng tim của trẻ. Ở các nước đang phát triển, tỷ lệ trẻ mắc bệnh tim bẩm sinh khoảng 0,7 - 1%. Tại Việt Nam, khoảng 12.000 trẻ em được sinh ra mỗi năm mắc dị tật bẩm sinh này và khoảng một nửa số trẻ cần được điều trị tại các bệnh viện tim mạch. 85% trẻ em sinh ra với dị tật tim phức tạp sẽ không thể đón sinh nhật 18 tuổi nếu không được phẫu thuật kịp thời. Việc Khám Sàng Lọc phát hiện ra trẻ mắc bệnh tim bẩm sinh là vô cùng cần thiết để giúp trẻ có cơ hội có được một trái tim khỏe mạnh và có một cuộc sống được học tập, vui chơi bình thường cùng bạn bè trang lứa. \n</p>\n<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230324133630-638152617902668032.jpg" style="width: 100%;"/>\n<p style="text-align: center;">\n\t<em>Khám sàng lọc giúp phát hiện ra trẻ mắc bệnh tim bẩm sinh là vô cùng cần thiết</em>\n</p>\n\n<p>\n\tTính từ năm 2007, chương trình “Rural Outreach Clinics – Khám Sàng Lọc” cùng với các bác sĩ phẫu thuật, bác sĩ tim mạch và y tá tình nguyện đến từ các bệnh viện Tim mạch hàng đầu tại Việt Nam đã tổ chức hơn 70 chuyến khám sàng lọc mỗi năm đến các huyện nông thôn trên cả nước. Mục tiêu của chương trình “Rural Outreach Clinics – Khám Sàng Lọc” là để tất cả trẻ em được khám tim, tư vấn, phẫu thuật và chăm sóc sau phẫu thuật nếu cần, bất kể vị trí địa lí và tình trạng kinh tế, làm giảm tỷ lệ tử vong và bệnh tật ở trẻ em. Tính từ năm 2007 đến hết tháng 2/2023, thông qua chương trình Khám Sàng Lọc của VCF, 296.959 trẻ em nghèo ở các vùng sâu, vùng xa đã được khám tim miễn phí; phát hiện 10.737 trẻ mắc bệnh tim bẩm sinh, trong đó có 8.715 trẻ được chỉ định phẫu thuật của bác sĩ.\n</p>\n\n<p>\n\t<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230324133658-638152618183302871.jpg" style="width: 100%;"/>\n</p>\n\n<p style="text-align: center;">\n\t<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230324133709-638152618295408831.jpg" style="width: 100%;"/>\n\t<em>Trẻ em nghèo ở các vùng sâu, vùng xa sẽ được thực hiện khám tim miễn phí</em>\n</p>\n\n<p>\n\t<strong>Chung tay hỗ trợ chi phí khám sàng lọc bệnh tim bẩm sinh trẻ em nghèo vùng sâu vùng xa</strong>\n</p>\n\n<p style="text-align: center;">\n\t<img alt="" src="https://static.mservice.io/blogscontents/momo-upload-api-230324133738-638152618581320221.jpg" style="width: 100%;"/>\n\t<em>Chung tay góp Heo Vàng hỗ trợ chi phí khám sàng lọc bệnh tim bẩm sinh cho trẻ em nghèo vùng sâu vùng xa</em>\n</p>\n\n<p>\n\tThông qua kênh quyên góp của MoMo, chương trình “Rural Outreach Clinics – Khám Sàng Lọc” đặt mục tiêu quyên góp 3.750.000 Heo Vàng thông qua Heo Đất MoMo. Số Heo Vàng sẽ được chương trình quy đổi với 760.000.000 đồng, tương ứng chi phí hỗ trợ 8 chuyến khám sàng lọc bệnh tim bẩm sinh tại 8 tỉnh thành tại Việt Nam nhằm phát hiện, chẩn đoán và đưa ra phác đồ điều trị cũng như phẫu thuật kịp thời để các em được sống với trái tim khỏe mạnh và một tương lai tươi sáng.\n</p>\n\n<p>\n\tĐể làm được điều đó, chương trình “Rural Outreach Clinics – Khám Sàng Lọc” rất cần sự chung tay của cộng đồng MoMo để giúp các em nhỏ có hoàn cảnh khó khăn được khám sàng lọc tim bẩm sinh ít nhất một lần trong đời. Những đóng góp đáng quý của các bạn, bất kể lớn hay nhỏ, đều góp phần mang đến cuộc đời mới cho hàng nghìn trẻ em nghèo và giúp các em lớn lên với trái tim khỏe mạnh.\n</p>\n\n<p>\n\t<u><strong>Về Chương trình “Rural Outreach Clinics – Khám Sàng Lọc”:</strong></u><br/>\n\tChương trình “Rural Outreach Clinics – Khám Sàng Lọc” là một chương trình Y tế thiết yếu được triển khai từ năm 2007 nhằm khám bệnh miễn phí cho trẻ em (0 - 16 tuổi) tại các vùng sâu vùng xa; và cung cấp các hỗ trợ thiết yếu khác cho trẻ em cùng gia đình. Với thông điệp "Hãy cho con bạn được khám tim ít nhất 1 lần trong đời", chương trình đã phối hợp với các bệnh viện, trung tâm tim mạch trên cả nước để tổ chức Khám Sàng Lọc cho trẻ em ở 49 tỉnh thành. Tính từ năm 2007 đến hết tháng 2/2023, thông qua chương trình Khám Sàng Lọc, 296.959 trẻ em nghèo ở các vùng sâu, vùng xa đã được khám tim miễn phí; phát hiện 10.737 trẻ mắc bệnh tim bẩm sinh, trong đó có 8.715 trẻ được chỉ định phẫu thuật của bác sĩ.\n</p>\n\n<p>\n\tKể từ khi bắt đầu hợp tác với MoMo, chương trình “Rural Outreach Clinics – Khám Sàng Lọc”  đã nhận được tổng nguồn hỗ trợ là 243.000.000 VNĐ khám sàng lọc bệnh tim bẩm sinh miễn phí cho hơn 6.300 trẻ em tại 3 tỉnh Quảng Nam, Hưng Yên và Gia Lai. \n</p>\nWebsite: <span style="color:#0066cc;">www.vinacapitalfoundation.org</span>',
